import React, { Component } from "react";
import { app } from "../utils/base";

class Home extends Component {
  state = {};

  componentDidUpdate() {
    let user = app.auth().currentUser;
    return <div>{user.email}</div>;
  }
  render() {
    console.log(user);
    return (
      <>
        <h1>Home</h1>
        <button onClick={() => app.auth().signOut()}>Sign out</button>
      </>
    );
  }
}

export default Home;
